    "2016-07-27T23:04:51.677522",nt"name": "draft-environmental-impact-statement-san-luis-valley-project-colorado-closed-basin-divisio",nt"isopen":
    false,nt"url": null,nt"notes": "The Closed Basin Division, San Luis Valley
    Project, Alamosa and Saguache Counties, Colorado, is a multi-purpose water resource
    plan designated to salvage and deliver to the Rio Grande water now being lost by
    evaporation and evapotranspiration in the Closed Basin.  The Closed Basin Division
    will allow the state of Colorado to meet its commitments for delivering water to
    New Mexico and Texas.  It will also provide stabilization of the water level of
    San Luis Lake, develop recreational facilities and will enhance fish and wildlife
    habitat.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
